import Container from "../components/Container";

const CreateCost = (style) =>{

    const formProps = {
        onSubmit: (values) =>{
            alert(JSON.stringify(values))
        },
        fields: [{
            label: 'User ID:',
            inputType: 'number',
            name: 'userId',
            required: true
        },
            {
                label: 'Category:',
                inputType: 'text',
                name: 'category',
                required: true
            },
            {
                label: 'Description:',
                inputType: 'text',
                name: 'description',
                required: true
            },
            {
                label: 'Sum:',
                inputType: 'number',
                name: 'sum',
                required: true
            },
            {
                label: 'Month:',
                inputType: 'month',
                name: 'monthAndYear',
                value: '2022-02',
                required: true
            }
        ],
        button: {
            value: 'Save Cost'
        }
    }

    return (
        <Container title='Create Cost' formProps={formProps}/>
    )
}
export default CreateCost;
